import * as React from "react";
import { Image } from "expo-image";
import { StyleSheet, Text, View } from "react-native";
import { Color, FontFamily, FontSize } from "../GlobalStyles";

const SessionScreen = () => {
  return (
    <View style={[styles.emptyScreen, styles.emptyScreenLayout]}>
      <Image
        style={styles.icon}
        contentFit="cover"
        source={require("../assets/11.svg")}
      />
      <View style={[styles.createNewSessionWrapper, styles.groupParentFlexBox]}>
        <Text style={[styles.createNewSession, styles.youHaveNoFlexBox]}>
          + Create new Session
        </Text>
      </View>
      <View style={[styles.groupParent, styles.groupParentFlexBox]}>
        <View style={styles.groupWrapper}>
          <View style={[styles.mySessionsWrapper, styles.wrapperPosition]}>
            <Text style={styles.historyTypo}>My Sessions</Text>
          </View>
        </View>
        <View style={styles.groupContainer}>
          <View style={[styles.historyWrapper, styles.wrapperPosition]}>
            <Text style={[styles.history, styles.historyTypo]}>History</Text>
          </View>
        </View>
      </View>
      <Text
        style={[styles.youHaveNo, styles.youHaveNoFlexBox]}
      >{`You have no sessions yet ! `}</Text>
      <View style={styles.arrowLoop}>
        <View style={[styles.arrowLoopChild, styles.emptyScreenLayout]} />
        <Image style={styles.icon1} contentFit="cover" source={`->_2`} />
      </View>
      <View style={[styles.emptyScreenInner, styles.groupParentFlexBox]}>
        <Image
          style={styles.menuIconLayout}
          contentFit="cover"
          source={require("../assets/ellipse-15.svg")}
        />
      </View>
      <Image
        style={[styles.menuIcon, styles.menuIconLayout]}
        contentFit="cover"
        source={require("../assets/menu.svg")}
      />
      <Image
        style={styles.tinkLogo1}
        contentFit="cover"
        source={require("../assets/tink-logo-1.png")}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  emptyScreenLayout: {
    width: "100%",
    backgroundColor: Color.white,
  },
  groupParentFlexBox: {
    flexDirection: "row",
    position: "absolute",
  },
  youHaveNoFlexBox: {
    textAlign: "center",
    color: Color.black,
  },
  wrapperPosition: {
    left: 0,
    top: 0,
    height: 22,
    position: "absolute",
  },
  historyTypo: {
    fontFamily: FontFamily.manropeSemiBold,
    fontWeight: "600",
    fontSize: FontSize.size_base,
    left: 0,
    top: 0,
    textAlign: "center",
    color: Color.black,
    position: "absolute",
  },
  menuIconLayout: {
    height: 24,
    width: 24,
  },
  icon: {
    top: 203,
    left: 77,
    width: 220,
    height: 220,
    position: "absolute",
    overflow: "hidden",
  },
  createNewSession: {
    fontSize: 14,
    fontFamily: FontFamily.rubikRegular,
    width: 146,
  },
  createNewSessionWrapper: {
    marginLeft: -151,
    bottom: 51,
    borderRadius: 100,
    borderStyle: "solid",
    borderColor: "#000",
    borderWidth: 1,
    height: 47,
    paddingHorizontal: 80,
    paddingVertical: 15,
    alignItems: "center",
    justifyContent: "center",
    left: "50%",
    backgroundColor: Color.white,
    flexDirection: "row",
  },
  mySessionsWrapper: {
    width: 95,
  },
  groupWrapper: {
    height: 22,
    width: 95,
  },
  history: {
    opacity: 0.5,
    width: 57,
  },
  historyWrapper: {
    width: 57,
  },
  groupContainer: {
    marginLeft: 16,
    width: 57,
    height: 22,
  },
  groupParent: {
    top: 150,
    left: 30,
  },
  youHaveNo: {
    top: 423,
    left: 92,
    fontSize: 12,
    fontWeight: "500",
    fontFamily: FontFamily.manropeMedium,
    width: 197,
    height: 16,
    position: "absolute",
  },
  arrowLoopChild: {
    height: "100%",
    top: "0%",
    right: "0%",
    bottom: "0%",
    left: "0%",
    position: "absolute",
  },
  icon1: {
    height: "32.2%",
    width: "33.39%",
    top: "18.52%",
    right: "31.32%",
    bottom: "49.28%",
    left: "35.29%",
    maxWidth: "100%",
    maxHeight: "100%",
    position: "absolute",
    overflow: "hidden",
  },
  arrowLoop: {
    marginLeft: -5.69,
    top: 468,
    width: 17,
    height: 27,
    left: "50%",
    position: "absolute",
  },
  emptyScreenInner: {
    top: 62,
    right: 24,
    width: 40,
    padding: 8,
  },
  menuIcon: {
    top: 70,
    left: 25,
    position: "absolute",
  },
  tinkLogo1: {
    marginLeft: -52.92,
    top: 66,
    width: 106,
    height: 32,
    left: "50%",
    position: "absolute",
  },
  emptyScreen: {
    borderRadius: 14,
    flex: 1,
    height: 812,
    overflow: "hidden",
  },
});

export default SessionScreen;
